import React from 'react';
import { NavLink } from 'react-router-dom';
import Button from "../buttons/Button";
import "../buttons/Button.css";
import "./Page.css"

const Navigation = () => {
    return (
        <div>
            <NavLink to="/login" class={"hey"}><Button type = {'primary'} title = {'Login'}/></NavLink>
            <NavLink to="/signUp" class={"hey"}><Button type = {'primary'} title = {'SignUp'}/></NavLink>
        </div>
    );
}

export default Navigation;
